      function doaction() {
        var msgs = content.shadowRoot.getElementById("room-content").childNodes[1].shadowRoot.getElementById("chat-content").querySelectorAll("div.message:not(.msgprocessed)");
        var currentmode = content.shadowRoot.getElementById("room-content").childNodes[1].shadowRoot.getElementById("chat-instant").getElementsByClassName("nickname")[0].title;

        if (lastmode != currentmode) {
          console.log("I think you switched, meaning we should wipe chat");
          document.getElementsByClassName("sendre")[0].innerHTML = "";
          // var thetab = document.getElementById("tab_#");
          // drawmsg("timestamps before " + gettime() + " have been reset.", thetab, "System", "appnotice", 0);
        }

        //      var nickname = msgs[0].getElementsByClassName("nickname")[0].innerHTML;
        //        var message = msgs[0].getElementsByClassName("content")[0].childNodes[0].shadowRoot.lastChild.innerHTML;
        //console.log(nickname);
        //          console.log(message);
        var type;
        var color;
        var i; //ffs okay so loops NEED to have this declared when running on the page.
        for (i = 0; i < msgs.length; i++) {


          if (msgs[i].classList.contains("system")) {
            var nickname = "System";
            var type = "appnotice";
            var color = 0;
          } else {
            var nickname = msgs[i].getElementsByClassName("nickname")[0].innerHTML;
            var type = "message";
            var person = nickname;
            if (colorusers.includes(person) == false) {
              colorusers.push(person);
            }

            var index = colorusers.indexOf(person) + 1;
            if (index > 12) {
              var whole = Math.trunc(index / 12);
              var index = index - (whole * 12);
            }
            console.log(index + " is color");
            var color = index;

          }
          //var nickname = msgs[i].getElementsByClassName("nickname")[0].innerHTML;
          var message = msgs[i].getElementsByClassName("content")[0].childNodes[0].shadowRoot.lastChild.innerHTML; //innerText
          var message = Autolinker.link(message);

          //          var text=message;
          //  var exp = /(\b(https?|ftp|file):\/\/[-A-Z0-9+&@#\/%?=~_|!:,.;]*[-A-Z0-9+&@#\/%=~_|])/ig;
          //  var text1=text.replace(exp, "<a target='_blank' href='$1'>$1</a>");
          //  var exp2 =/(^|[^\/])(www\.[\S]+(\b|$))/gim;
          //  message = text1.replace(exp2, '$1<a target="_blank" href="http://$2">$2</a>'); //really really basic and quick hyperlink replacement. because apparently you can't reliably process anchors in chrome shadow dom.

          //console.log(msgs[i].getElementsByClassName("content")[0].childNodes[0].shadowRoot.lastChild);
          //var message = msgs[i].getElementsByClassName("content")[0].childNodes[0].shadowRoot.lastChild.querySelectorAll("a")[0].innerHTML;

          //var message = "message";
          var thetab = document.getElementById("tab_#");
          drawmsg(message, thetab, nickname, type, color);
          console.log(nickname + " says: " + message);
          msgs[i].classList.add("msgprocessed");
        }

        if (i > 9) {
          console.log("Wow just processed " + i + " lines at once. perhaps an error has occured????");
          if (lastmode != currentmode) {
            console.log("not to worry, you just came from PM's");
          } else if (lastmode == currentmode) {
            console.log("oh crap, it could be fucked, or maybe you closed a PM from the mainchat. swaperror disabled though for that reason, maybe its fixed idk?");
          }

        }

        if (lastmode != currentmode) { //im doing this to create a line after it finishes once the mode changes once.
          //console.log("I think you switched, meaning we should wipe chat");
          //document.getElementsByClassName("sendre")[0].innerHTML = "";
          var thetab = document.getElementById("tab_#");
          drawmsg("――――――――――――――――――――――――――――――", thetab, "System", "appnotice", 0);
        }

        lastmode = content.shadowRoot.getElementById("room-content").childNodes[1].shadowRoot.getElementById("chat-instant").getElementsByClassName("nickname")[0].title;
      }

