  function drawmsg(message, tab, from, type, colornum) {

    console.log("hi");

    var timestamp = '<div class="timestamp">' + gettime() + '</div>';
    var from = from; //eventually may switch this to a nickname rather than literal id

    //var div = document.getElementById(tab);
    var div = tab.getElementsByClassName("sendre")[0];
    //var div = document.getElementById("mainchat").getElementsByClassName("sendre")[0];
    var scrolllock = checkscrolllock(div);
    //var scrolllock = checkscrolllock(div);
    var color = {
      "1": "hsl(211,51%,45%)",
      "2": "hsl(144,58%,34%)",
      "3": "hsl(294,25%,50%)",
      "4": "hsl(360,62%,44%)",
      "5": "hsl(19,39%,33%)",
      "6": "hsl(35,80%,49%)",
      "7": "hsl(193,40%,63%)",
      "8": "hsl(113,39%,43%)",
      "9": "hsl(255,25%,60%)",
      "10": "hsl(352,66%,74%)",
      "11": "hsl(29,41%,48%)",
      "12": "hsl(45,100%,46%)",
      //Lighter Original
      "13": "hsl(211,51%,65%)",
      "14": "hsl(144,58%,54%)",
      "15": "hsl(294,25%,70%)",
      "16": "hsl(360,62%,64%)",
      "17": "hsl(19,39%,53%)",
      "18": "hsl(35,80%,69%)",
      "19": "hsl(193,40%,83%)",
      "20": "hsl(113,39%,63%)",
      "21": "hsl(255,25%,80%)",
      "22": "hsl(352,66%,64%)",
      "23": "hsl(29,41%,68%)",
      "24": "hsl(45,100%,66%)",
      //Custom Colors
      "25": "hsl(0,0%,62%)",
      "26": "hsl(0,20%,9%)",
      "27": "hsl(2,57%,46%)",
      "28": "hsl(20,100%,16%)",
      "29": "hsl(25,63%,46%)",
      "30": "hsl(35,14%,43%)",
      "31": "hsl(55,26%,36%)",
      "32": "hsl(95,47%,35%)",
      "33": "hsl(57,57%,57%)",
      "34": "hsl(61,80%,61%)",
      "35": "hsl(55,53%,31%)",
      "36": "hsl(80,36%,36%)",
      "37": "hsl(93,76%,58%)",
    };
    // var message = scrubmessage(message); //get rid of dat formatting
    var themessagediv = document.createElement("div");
    themessagediv.className = "chatentry";
    themessagediv.style.color = color[colornum];

    if (type == "message") {
      themessagediv.innerHTML = `${timestamp}` + `${from}: ${message}`;
    }
    if (type == "enteredroom") {
      themessagediv.innerHTML = `${timestamp}` + `${from} entered the room.`;
      themessagediv.style.color = "black";
    }
    if (type == "leftroom") {
      themessagediv.innerHTML = `${timestamp}` + `${from} left the room.`;
      themessagediv.style.color = "black";
    }
    if (type == "changednick") {
      themessagediv.innerHTML = `${timestamp}` + `${from} changed nickname to ${message}`;
      themessagediv.style.color = "black";
    }
    if (type == "appnotice") {
      themessagediv.innerHTML = message;
      themessagediv.style.fontWeight = "bold";
    }

    div.appendChild(themessagediv); //append whatever message

    decidescroll(div, scrolllock); //function to decide whether to scroll down or not whether scroll was true or false. if false it does nothing
  } //end of drawmsg

  function checkscrolllock(div) {
    var sum = (div.scrollHeight - div.scrollTop);

    if (sum >= (parseFloat(div.clientHeight) - 3) && sum <= (parseFloat(div.clientHeight) + 3)) { //if sum is within 3 pixels either way means it is scrolled down
      return true;
    } else {
      return false;
    }
  } //end of checkscrolllock

  function decidescroll(div, scrolllock) {
    if (scrolllock == true) { //so if it's already scrolled down before we placed stuff, we'll scroll down again
      div.scrollTop = div.scrollHeight;
    }
  } //end of decidescroll


  function gettime() {
    var timeformat;
    timeformat = "AMPM";

    var currentTime = new Date();
    var hours = currentTime.getHours();
    var minutes = currentTime.getMinutes();
    console.log(hours, minutes);
    var ampm;
    if (minutes < 10) {
      minutes = "0" + minutes;
    }
    if (timeformat == "AMPM") {
      if (hours >= 12) {
        ampm = "PM";
        if (hours > 12) {
          hours = hours - 12;
        }

      } else {
        ampm = "AM";
      }
      if (hours == 0) {
        hours = 12;
      }
      return (hours + ":" + minutes + " " + ampm + " ");
    }
    if (timeformat == "24") {
      if (hours < 10) {
        hours = "0" + hours;
      }
      return (hours + ":" + minutes);
    }

  } //end of gettime

